import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <h1>Original Pokemon</h1>
        <h3>Fire Type</h3>
        <ul>
          <li>Charmander</li>
          <li>Charmeleon</li>
          <li>Charizard</li>
        </ul>
        <hr/>
        <h3>Water Type</h3>
        <ul>
          <li>Squirtle</li>
          <li>Wartortle</li>
          <li></li>
        </ul>
        <hr/>
        <h3>Grass Type</h3>
        <ul>
          <li></li>
          <li></li>
          <li></li>
        </ul>
        <hr/>
      </div>
    );
  }
}

export default App;
